import React from 'react';
import ReactDOM from 'react-dom';

const Hello = () => {
  return (
    <div>
      <p> Hello</p>
    </div>
  )
}


const App = () => {
  console.log("Nget wget")
  const now = new Date()
  const a = 10
  const b = 20
  return(
    <div>
      <p>Hello world, {now.toString()}</p>
      <p> {a} + {b} = {a+b}</p>
      <Hello/>
      <Hello/>
  </div>)
}

ReactDOM.render(<App />, document.getElementById('root'))
